import styles from './style.module.scss';

let schema;
try {
    schema = JSON.parse(window.localStorage?.schema);
} catch (e) { };

const BannerSchema = schema?.children?.[0] || {};
const Banner = () => {
    const Myname = BannerSchema?.attributes?.Myname || '鸡杂不下面的小站';
    const description = BannerSchema?.attributes?.description || '热爱生活，热爱Coding';
    return (
        <div className={`wrapper ${styles.BannerWrapper}`}>
            <div className={styles.Banner}>
                <img className={styles.PersonImg} src='https://blog-project-static-file.oss-cn-hangzhou.aliyuncs.com/images/person.jpg' alt='图片'></img>
                <div className={styles.title}>{Myname}</div>
                <div className={styles.dsc}>
                    {description}
                </div>
            </div>
        </div>

    )
}

export default Banner;
